      description: '↑ Kreis Nordfriesland: „In Blau drei goldene dreimastige Schiffe im Stil des 16. Jahrhunderts in der Stellung 2 : 1 mit goldenen Segeln und roten Wimpeln; auf den Großsegeln je ein rotes Beizeichen (1. Pflug, 2. Fisch, 3. Stierkopf).“ (Kommunale Wappenrolle Schleswig-Holstein) |||| Kreiswappen Nordfriesland[1] (Details) |||| Die Flagge des Kreises Blasonierung: „In Blau drei goldene dreimastige Schiffe im Stil des 16. Jahrhunderts in der Stellung 2 : 1 mit goldenen Segeln und roten Wimpeln; auf den Großsegeln je ein rotes Beizeichen (1. Pflug, 2. Fisch, 3. Stierkopf).“[19] Das Wappen beruht mit Modifikationen auf dem historischen Wappen von 1613 des alten Kreises Eiderstedt. Es entstand 1970 bei der Zusammenlegung der drei Kreise Südtondern, Husum und Eiderstedt und ist in den friesischen Farben Blau, Gold und Rot gehalten. Die drei Schiffe symbolisieren dabei sowohl die friesische Einheit als auch die Bedeutung, die Meer und Schifffahrt immer für den Kreis hatten. Pflug und Stierkopf stehen für die Landwirtschaft im Kreis, der Fisch für den Fischfang. Fisch und Stierkopf stammen dabei ebenfalls aus dem Eiderstedter Wappen. Der Fisch entspricht dem Sylter Hering, dem Symbol der Insel Sylt. Siehe auch: Liste der Wappen im Kreis Nordfriesland Flagge: „In der Mitte eines blauen, oben und unten von je zwei schmalen Streifen, einem äußeren roten und einem inneren goldenen, eingefassten Feldes die drei Schiffe des Wappens (2 : 1), etwas zur Stange hin verschoben.“[19]',
